INSERT INTO `message` (`id`, `user_id`, `thread_id`, `text`, `seen`, `files`, `created_at`, `updated_at`) VALUES (1,10,1,'Bonjour Cem,',1,'a:0:{}','2022-04-05 13:18:29','2022-04-05 14:56:29'),(2,10,1,'Ca y est, j\'ai passé ma 1ere commande pour l\'ourlet du jean de Gérard. Merci de me confirmer quand ça sera effectué',1,'a:0:{}','2022-04-05 13:19:38','2022-04-05 14:56:29'),(3,8,1,'Bonjour Emmanuelle, ',1,'a:0:{}','2022-04-05 14:56:54','2022-04-05 15:06:10'),(4,8,1,'Bonjour Emmanuelle, ',1,'a:0:{}','2022-04-05 14:57:12','2022-04-05 15:06:11'),(5,8,1,'Bonjour Emmanuelle, c\'est parti!',1,'a:0:{}','2022-04-05 14:57:49','2022-04-05 15:06:11'),(6,10,1,'Top: excellent! Le début d\'une grande aventure!',1,'a:0:{}','2022-04-05 15:06:51','2022-04-05 15:13:39'),(7,10,1,'Coucou Cem, Nicole a appuyé sur le bouton  \'prestation effectuée\': j\'ai payé cette première commande avec ma carte American Express et tu devrais recevoir le paiement de 8€ dans 3 jours :-)',1,'a:0:{}','2022-04-05 15:10:09','2022-04-05 15:13:39'),(8,10,1,'Je t\'ai également envoyé une demande de devis pour la doudoune. Je te propose qu\'on fasse ça ensemble pour te montrer comment effectuer un devis dans l\'application. Ca te va? ',1,'a:0:{}','2022-04-05 15:16:49','2022-04-05 15:52:33'),(9,10,1,'Merci pour ta confiance :-)',1,'a:0:{}','2022-04-05 15:17:39','2022-04-05 15:52:33'),(10,10,1,'voilà la photo de ma doudoune (déjà réparée....hahaha!) pour le devis',1,'a:1:{i:0;s:68:\"/media/624c60d0364bf_Photo doudoune North Face \'1ère commande!).jpg\";}','2022-04-05 15:31:40','2022-04-05 15:52:33'),(11,8,1,'Ok',1,'a:0:{}','2022-04-05 15:52:57','2022-04-05 16:06:25'),(12,10,1,'Super et bravo pour ta dextérité: la création de ta boutique en ligne est en route! Bonne soirée à toi et on essaie de passer vendredi matin pour le devis et compléter ta page vitrine (on prendra une photo de toi devant ta belle boutique!) Bonne soirée!',1,'a:0:{}','2022-04-05 16:09:46','2022-04-05 16:14:46'),(13,8,1,'Merci emmanuelle, bonn